import React from 'react';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faBus } from '@fortawesome/free-solid-svg-icons';
import { useNavigate } from 'react-router-dom';
import './AluguelOnibus.css';

const AluguelOnibus = () => {
  const navigate = useNavigate();

  const handleNavigateFrota = () => navigate('/nossa-frota');
  const handleNavigateOrcamento = () => navigate('/contato');

  const services = [
    {
      id: 1,
      description: "Desenvolvemos uma logística de transporte otimizada para sua empresa. Atendemos contratos fixos e serviços temporários. Nossa equipe é capacitada para transporte empresarial.",
    },
    {
      id: 2,
      description: "Atendemos os mais diferentes tipos de eventos no Brasil e Exterior. A flexibilidade de horários e a diversidade da nossa frota nos permitem ter a agilidade necessária para eventos.",
    },
    {
      id: 3,
      description: "Seu sonho é conhecer lugares diferentes? Você escolhe o destino e nós oferecemos as melhores opções para sua viagem aos países da América do Sul.",
    },
    {
      id: 4,
      description: "Grupos da melhor idade, religiosos, familiares, escolas, times de futebol, compras. Você escolhe o destino e nós oferecemos as melhores condições para a sua viagem.",
    },
    {
      id: 5,
      description: "Desenvolvemos uma logística de transporte otimizada para você e sua empresa. Atendemos contratos fixos e serviços temporários. Somos capacitados para atender você e sua empresa.",
    },
    {
      id: 6,
      description: "Programamos seu translado para quaisquer aeroportos do Brasil. O conforto e a pontualidade são garantidos por nosso serviço competente.",
    },
  ];

  return (
    <div className="aluguel-container">
      <h1>Aluguel de Ônibus</h1>
      <div className="aluguel-grid">
        {services.map((service) => (
          <div key={service.id} className="aluguel-card">
            <FontAwesomeIcon icon={faBus} size="2x" className="aluguel-icon" />
            <p>{service.description}</p>
          </div>
        ))}
      </div>
      <div className="aluguel-buttons">
        <button onClick={handleNavigateFrota}>Conhecer Frota</button>
        <button onClick={handleNavigateOrcamento}>Fazer Orçamento</button>
      </div>
    </div>
  );
};

export default AluguelOnibus;
